<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, user-scalable=no">
    <title>Realistic 3D Car Racer</title>
    <style>
        body {
            margin: 0;
            overflow: hidden;
            background: #111;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            font-family: 'Arial', sans-serif;
        }

        .game-container {
            width: 100%;
            max-width: 500px;
            height: 100%;
            overflow: hidden;
            position: relative;
            background: linear-gradient(#333, #000);
            perspective: 800px; /* Increased perspective for better 3D */
        }

        .sky {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 50%;
            background: linear-gradient(#0077be, #87ceeb);
            z-index: 1;
        }
        
        .scenery {
            position: absolute;
            bottom: 50%;
            left: 0;
            width: 100%;
            height: 50px;
            background: #2b8a3e; /* Green hills */
            z-index: 1;
        }

        .road-container {
            position: absolute;
            bottom: 0;
            width: 100%;
            height: 50%;
            transform-style: preserve-3d;
        }

        .road {
            position: absolute;
            width: 1000px; /* Wider road for a better feel */
            height: 400px;
            background: #4a4a4a;
            left: 50%;
            transform-origin: bottom;
            transform: translateX(-50%) rotateX(65deg) translateZ(-180px);
            z-index: 2;
            border-left: 20px solid #dcdde1; /* Guardrails */
            border-right: 20px solid #dcdde1;
        }

        .line {
            position: absolute;
            left: 50%;
            transform: translateX(-50%);
            width: 15px;
            height: 50px;
            background: #fff;
            z-index: 3;
        }

        .player, .obstacle {
            position: absolute;
            width: 100px;
            height: 100px;
            background-size: contain;
            background-repeat: no-repeat;
            background-position: center;
            z-index: 10;
            transform-origin: center;
        }
        
        .player {
            left: 50%;
            bottom: 10px;
            transform: translateX(-50%);
        }
        
        /* UI and Screens */
        .ui-container {
            position: absolute;
            top: 0; left: 0;
            width: 100%; height: 100%;
            z-index: 20;
            color: white;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
        }

        .score {
            position: absolute;
            top: 20px;
            left: 50%;
            transform: translateX(-50%);
            font-size: 2.5em;
            font-weight: bold;
            text-shadow: 3px 3px 5px #000;
        }

        .screen {
            position: absolute;
            width: 100%;
            height: 100%;
            background: rgba(0,0,0,0.8);
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            text-align: center;
            padding: 20px;
        }
        
        .screen h1 {
            font-size: 3em;
            text-transform: uppercase;
            letter-spacing: 2px;
            margin-bottom: 10px;
        }
        .screen p {
            font-size: 1.2em;
            margin-bottom: 25px;
        }
        
        .car-selection {
            display: flex;
            gap: 20px;
            margin-bottom: 30px;
        }
        
        .car-option {
            width: 100px;
            height: 100px;
            background-size: contain;
            background-position: center;
            background-repeat: no-repeat;
            cursor: pointer;
            border: 4px solid transparent;
            border-radius: 10px;
            padding: 5px;
            transition: transform 0.2s, border-color 0.2s;
        }

        .car-option:hover {
            transform: scale(1.1);
        }

        .car-option.selected {
            border-color: #0984e3;
            transform: scale(1.1);
        }

        .button {
            padding: 15px 40px;
            font-size: 1.5em;
            font-weight: bold;
            cursor: pointer;
            border-radius: 10px;
            border: none;
            background: #0984e3;
            color: white;
            text-transform: uppercase;
        }
        
        .touch-controls {
            display: none;
            width: 100%;
            height: 100%;
            position: absolute;
            top:0; left: 0;
        }

        .touch-zone { position: absolute; width: 50%; height: 100%; }
        .touch-left { left: 0; }
        .touch-right { right: 0; }

        @media (hover: none) and (pointer: coarse) {
            .touch-controls { display: block; }
        }

    </style>
</head>
<body>

    <div class="game-container">
        <div class="sky"></div>
        <div class="scenery"></div>
        <div class="road-container">
            <div class="road"></div>
        </div>
        <div class="player"></div>

        <div class="ui-container">
            <div class="score" id="score-display">Score: 0</div>
            
            <div class="screen" id="start-screen">
                <h1>3D Real Racer</h1>
                <p>Choose your car and avoid the traffic!</p>
                <div class="car-selection">
                    <!-- Car options will be populated by JavaScript -->
                </div>
                <button class="button" id="start-button">Start Race</button>
            </div>

            <div class="screen" id="game-over-screen" style="display: none;">
                <h1>Game Over</h1>
                <p id="final-score"></p>
                <button class="button" id="restart-button">Restart</button>
            </div>

            <div class="touch-controls">
                <div class="touch-zone touch-left"></div>
                <div class="touch-zone touch-right"></div>
            </div>
        </div>
    </div>
